; This file does not describe terrain types like the game knows them. It
; describes terrain types as guidelines for generating height maps and for
; visualization. This means that "Clear" means flat terrain, not passable
; terrain, and "Road" includes the roads going over bridges. Most notably,
; all cliffs have been divided into "cliff face" and "plateau" to accurately
; know their intended height, and to show which way they are facing.

; X            Horizontal amount of tiles in the tileset.
; Y            Vertical amount of tiles in the tileset.
; Terrain#     Terrain type definitions. # ranges from 0 to Y-1, and each line
;              contains Y letters.
;              Terrain types:
;               _ = Unused
;               C = Clear
;               W = Water
;               I = Rock (Impassable)
;               B = Beach
;               R = Road
;               V = River
;               F = Cliff face
;               P = Cliff plateau (land cliff)
;               L = Cliff plateau (water cliff)
;               M = Smudge
;               S = Snow
; PrimaryType  kept purely as fallback, to fill tiles of this type that fall
;              outside the known dimensions.

